import{_ as e,c as n,o as t,aM as s}from"./chunks/framework.DAyGILei.js";const r="/assets/tunnel_1.L5ykCGbZ.png",i="/assets/tunnel_2.CwP41VX4.png",a="/assets/tunnel_3.C0AkpA0S.png",c="/assets/sync_1.CSNMdGs7.png",l="/assets/sync_2.Bksovxjo.png",d="/assets/sync_3.BFVRIYhI.png",p="/assets/sync_4.CzCmhx1C.png",b=JSON.parse('{"title":"WinSCP","description":"Installation and usage guide for WinSCP.","frontmatter":{"title":"WinSCP","category":"Transfer tools","permalink":"/do-science/tools/transfer/winscp","outline":1,"description":"Installation and usage guide for WinSCP."},"headers":[],"relativePath":"do-science/tools/transfer/winscp.md","filePath":"do-science/tools/transfer/winscp.md"}'),u={name:"do-science/tools/transfer/winscp.md"};function h(g,o,f,m,y,S){return t(),n("div",null,[...o[0]||(o[0]=[s('<h1 id="winscp" tabindex="-1">WinSCP <a class="header-anchor" href="#winscp" aria-label="Permalink to &quot;WinSCP&quot;">​</a></h1><p><strong><a href="https://winscp.net/" target="_blank" rel="noreferrer">WinSCP</a> is an open source data transfer client for Windows that work with commonly used transfer protocols including SFTP, S3 and SCP.</strong></p><p>If your host organization allows, you can use WinSCP for file transfers and synchronization of folders between your local computer and your lab machines.</p><nav class="table-of-contents"><ul><li><a href="#install">Install</a></li><li><a href="#configure">Configure</a></li><li><a href="#synchronize">Synchronize</a></li></ul></nav><div class="warning custom-block"><p class="custom-block-title">Requirement</p><ul><li>Windows operating system.</li><li>A <a href="/do-science/lab-access/">working connection</a> to your lab.</li></ul></div><h2 id="install" tabindex="-1">Install <a class="header-anchor" href="#install" aria-label="Permalink to &quot;Install&quot;">​</a></h2><p>On your local computer, download WinSCP from <a href="https://winscp.net/eng/download.php" target="_blank" rel="noreferrer">winscp.net</a> and install the software. This may required administrator privileges.</p><h2 id="configure" tabindex="-1">Configure <a class="header-anchor" href="#configure" aria-label="Permalink to &quot;Configure&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This section configures WinSCP to connect your local computer to your <a href="/do-science/faq/compute#machine-types">home machine</a>. Additional configurations will be needed for connections to iaas and blue machines.</p></div><p>You will see the <strong><code>Login</code></strong> screen when you start WinSCP for the first time.</p><p><img src="'+r+'" alt="SSH Tunnel - Step 1" title="SSH Tunnel - Step 1"></p><p>In this <strong><code>Session tab</code></strong> insert:</p><ul><li>File protocol: <strong><code>SFTP</code></strong></li><li>Host name: <strong><code>10.5.5.12</code></strong></li><li>Protocol: <strong><code>22</code></strong></li><li>User name: <strong><code>&lt;your-username&gt;</code></strong></li><li>Password: <strong><code>&lt;your-ssh-password&gt;</code></strong></li></ul><p>Click <strong><code>Advanced</code></strong> and select <strong><code>Tunnel</code></strong>:</p><p><img src="'+i+'" alt="SSH Tunnel - Step 2" title="SSH Tunnel - Step 2"></p><p>In the <strong><code>Tunnel tab</code></strong> insert:</p><ul><li>Connect through SSH tunnel: <strong><code>Check</code></strong></li><li>Host name: <strong><code>&lt;your-lab-IP&gt;</code></strong> (You can find your lab ip in your lab access link, if you don&#39;t have access to the link any more, request a new one through <a href="https://docs.hdc.ntnu.no/do-science/service-desk/#request-lab-access-link-reissue" target="_blank" rel="noreferrer">here</a>)</li><li>Protocol: <strong><code>22</code></strong></li><li>User name: <strong><code>&lt;your-username&gt;</code></strong></li><li>Password: <strong><code>&lt;your-ssh-password&gt;</code></strong></li></ul><p>Click <strong><code>Ok</code></strong> when completed.</p><p>Once you have confirmed the advanced settings you will get back to previous window. Hit <strong><code>Login</code></strong>.</p><p><img src="'+a+'" alt="SSH Tunnel - Step 4" title="SSH Tunnel - Step 4"></p><p>With a little bit of luck, you should be able to see the files in your lab on the right side of your screen.</p><h2 id="synchronize" tabindex="-1">Synchronize <a class="header-anchor" href="#synchronize" aria-label="Permalink to &quot;Synchronize&quot;">​</a></h2><p><a href="https://winscp.net/eng/docs/task_synchronize" target="_blank" rel="noreferrer">Synchronization</a> is an additional feature that provides advanced copying. For example, when only a subset of updated files or only a new files have to be copied a lot of time can be saved compared to normal copy in WinSCP, which transfers all of the files every time your transfer a folder.</p><p>When selected the folder to be synchronized this option can be found in <strong><code>Commands</code></strong> menu as <strong><code>Synchronize...</code></strong> (Ctrl+S).</p><p><img src="'+c+'" alt="Synchronization - Step 1" title="Synchronization - Step 1"></p><p>Synchronization allows multiple adjustments such as synchronization towards target, but also both ways. Whether one wants to synchronize deleted files or what comparison criteria one would like to use.</p><p><img src="'+l+'" alt="Synchronization - Step 2" title="Synchronization - Step 2"></p><div class="warning custom-block"><p class="custom-block-title">Be careful!</p><p>Selecting <strong><code>Both</code></strong> or <strong><code>Local</code></strong> targets will download data from your lab to your local computer. It is your responsibility to only use this configuration for folders in your lab that contains non-sensitive data that you can keep on your local computer.</p></div><p>When confirmed, a file comparison is done by WinSCP, where one can choose files to be synchronized. Click <strong><code>Ok</code></strong> to confirm.</p><p><img src="'+d+'" alt="Synchronization - Step 3" title="Synchronization - Step 3"></p><p>You will get a confirmation status when your synchronization is completed.</p><p><img src="'+p+'" alt="Synchronization - Step 4" title="Synchronization - Step 4"></p>',32)])])}const _=e(u,[["render",h]]);export{b as __pageData,_ as default};
